import React, { Component } from 'react'
import './vetsearch.css'


export default class Vetsearch extends Component {
    render() {
        return (
            <div className="vet">
                <form>
                    <label>Busca el email de un usuario</label>
                    <input placeholder="email" type="text"></input>
                </form>
            </div>
        )
    }
}
